import React from "react";
import BackgroundImage2 from '../background.png'

function Header()
{
  return (
    <header>
      <img src="../background.png"  width = "100%" height = "100" top = "0" z-index = "-5"></img>
      <img src="http://razzlers.me:8080/Razzlers_files/Razzlers-Logo.png" width="300" height="auto" top="0" z-index="0"/>
    </header>
  )
}
export default Header
